import Header from './Header';
import SongRow from './SongRow';
import "./style.css"
const Body = () => {
    return (
        <div className='body'>
            <Header/>
            <div className="songInfo">
                <div className=""></div>
                
            </div>
            <SongRow/>
        </div>
    );
};

export default Body;
